export const colores ={
    gris700: "#344955", //oscuro
    naranja500: "#F9AA33", //naranja
    blanco: "#FFFFFF",
    gris600: "#4A6572",
    gris800: "#232F34",
    textoTitulo: "#FFF",
};
export const sizes ={
    base: 8,
    font: 14,
    fontTitulo: 40,
    radiusContenedor: 30,
    padding1: 10,
    margin1: 10,
    padding2: 12,
};
const estilo = { colores, sizes};

export default estilo;
